import { Accordion, Card } from '@material-ui/core'
import React,{useState,useEffect} from 'react'
import { Button, Col, Form, Row } from 'react-bootstrap'
import axios from 'axios'
function AnswerFaq() {
    const [posts, setPosts] = useState([])
    useEffect(() => {
        async function fetchPost()
        {
            await axios.get('http://localhost:8080/admin/noanswerfaq')
            .then((data)=>setPosts(data.data))
            .catch((e)=>console.log(e))
        }
        fetchPost();
    }, [])
    return (
        <div>

            {posts.length>0 && posts.map((post)=>{
                return (
                    <>

                    <Form>
                    <Form.Group as={Row} controlId="formPlaintextEmail">
                        <Form.Label column sm="2">
                        Question
                        </Form.Label>
                        <Col sm="10">
                        <Form.Control plaintext readOnly defaultValue={post.question} />
                        </Col>
                    </Form.Group>

                    <Form.Group as={Row} controlId="formPlaintextPassword">
                        <Form.Label column sm="2">
                        Answer
                        </Form.Label>
                        <Col sm="10">
                        <Form.Control type="text" placeholder="Enter Answer" />
                        </Col>
                    </Form.Group>
                    </Form>
                    </>
                )
            })}

        </div>
    )
}

export default AnswerFaq
